import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Use Routes ao invés de Switch
import formação from './components/pages/formação'; // Verifique se está com 'f' minúsculo
import sobremim from './components/pages/sobremim'; // Verifique se está com 's' minúsculo
import Projetosrealizados from './components/pages/Projetosrealizados';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes> {/* Altere Switch para Routes */}
          <Route path='/' element={<Home />} /> {/* Use o elemento ao invés de component */}
          <Route path='/sobremim' element={<sobremim />} /> {/* Use o elemento ao invés de component */}
          <Route path='/formação' element={<formação />} /> {/* Use o elemento ao invés de component */}
          <Route path='/Projetosrealizados' element={<Projetosrealizados />} /> {/* Use o elemento ao invés de component */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
